import React from 'react';
import s from '../StyleSheets/SearchBar.module.css';

export default function SearchBar({ onSearch }) {
  return (

    <div>

      <div className={`${s.contenedorBarra}`}>
        <input className={`${s.inputCont}`}
        type="text"
          placeholder='Search city...' />
        <button 
        className={`${s.botonAdd}`}
        onClick={() => onSearch('Searching...')}>Add</button>
      </div>

    </div>

  )
};
